/* ONE light UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.key-binding-resolver {
  -webkit-flex: 0.25;
  overflow: auto;
}
.key-binding-resolver .keystroke {
  margin-right: 1em;
}
.key-binding-resolver table .used {
  color: #2db448;
}
.key-binding-resolver table .unused {
  color: #3b404a;
}
.key-binding-resolver table .unmatched {
  color: rgba(59, 64, 74, 0.7);
}
.key-binding-resolver table .used .command::before,
.key-binding-resolver table .unused .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f03a";
}
.key-binding-resolver table .unmatched .command::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f081";
}
.key-binding-resolver table .command,
.key-binding-resolver table .selector,
.key-binding-resolver table .source {
  min-width: 10em;
}
.key-binding-resolver table .source {
  cursor: pointer;
}
